(385, 7, 91, 'Ejecución de Obras o Ampliaciones antirreglamentarias', '<p>La ejecuci&oacute;n de obras o ampliaciones antirreglamentarias, ser&aacute; sancionada con multa de 10 a 15.000 m&oacute;dulos<strong>. </strong>En caso que la infracci&oacute;n se verifique sobre un inmueble declaradode inter&eacute;s arquitect&oacute;nico la pena de multa podr&aacute; ascender al triplo de la establecida como tope en la presente.</p>', 45000, 10, 0, 0, '', 0, now(), now()),
(386, 7, 92, 'Ejecución de Demoliciones de Inmuebles sin permiso municipal', '<p>La ejecuci&oacute;n de demoliciones de inmuebles sin permiso municipal, ser&aacute; sancionada con multa de 10 a 15.000 m&oacute;dulos y/o inhabilitaci&oacute;n hasta 90 d&iacute;as. En caso que la infracci&oacute;n se verifique sobre un inmueble declarado de inter&eacute;s arquitect&oacute;nico la pena de multa podr&aacute; ascender al triplo de la establecida como tope en la presente.</p>', 45000, 10, 0, 0, '', 0, now(), now()),
(387, 7, 89, 'Ejecución de Obras o Instalaciones sin permiso municipal', '<p>La ejecuci&oacute;n de obras o instalaciones sin permiso municipal, ya sean nuevas o bien ampliaciones o modificaciones de las existentes, ser&aacute; sancionado con multa de 10 a 15.000 m&oacute;dulos y/o inhabilitaci&oacute;n hasta 90 d&iacute;as. En caso que la infracci&oacute;n se verifique sobre un inmueble declarado de inter&eacute;s arquitect&oacute;nico la pena de multa podr&aacute; ascender al triplo de la establecida como tope en la presente.</p>', 45000, 10, 0, 0, '', 0, now(), now()),
(388, 1, 91, 'Ejecución de Obras o Ampliaciones antirreglamentarias ( Modif. por Ordenanza 10897)', '<p>La ejecuci&oacute;n de obras o ampliaciones antirreglamentarias, ser&aacute; sancionada con multa de 10 a 15.000 m&oacute;dulos<strong>. </strong>Encaso que la infracci&oacute;n se verifique sobre un inmueble declaradode inter&eacute;s arquitect&oacute;nico la pena de multa podr&aacute; ascender al triplo de la establecida como tope en la presente.</p>', 45000, 10, 0, 0, '', 0, now(), now()),
